import base64
import json
import zlib
import pymongo as mongo

BS_DATA = """"""

def init(conn):
    #conn = mongo.Connection()
    db =conn.meta
    for collection, values in json.loads(zlib.decompress(base64.b64decode(BS_DATA))).items():
        if collection in db.collection_names(): continue
        for key, value in values.items():
            db[collection].update({'_id': key}, value, upsert = True, safe = True)

